import './App.css';
import {BrowserRouter as Router, Route, Routes, Link} from "react-router-dom";
import { Login } from './login';
import { Register } from './register';


function App() {
   //get user data on submit
  

  
  return (
    <div className="App">
      <>
        <Login/>
        </>
    <Router>
      <Routes>
        <Route exact path="/" element= {<Login/>}/>
        
      </Routes>
    </Router>
    </div>
  );
}

export default App;
